import React from "react";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/NavBar.js";
import Jumbotron from "./components/Jumbotron.js";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <NavBar />
        <Jumbotron />
      </div>
    );
  }
}

export default App;
